import { Button } from '../navbar/Button'
import { PlanMonth } from './PlanMonth'
import { PlanYear } from './PlanYear'
import { StepTwoHeader } from './StepTwoHeader'

function StepTwo() {
    return (
        <div className="two">
            <div className="step-two">
                <StepTwoHeader />
                {month ? <PlanYear /> : <PlanMonth />}
            </div>
            <Button />
        </div>
    )
}

export { StepTwo }
